import React from "react";
import RollingCarousel from "./Carousel/RollingCarousel";
import CategoryContainer from "./categories/CategoryContainer";
import "./Home.css";
import One from "./products/One";
import Third from "./products/Third";
import Two from "./products/Two";

function Home() {
  return (
    <div>
      <div className="container-fluid">
        <CategoryContainer />

        <div className="mt-4 col-md-12 text-center">
          <center>
            <h2 style={{ marginBottom: "40px", marginTop: "-50px" }}>
              Welcome <b>Guest</b>
            </h2>
          </center>
        </div>

        <div className="card">
          <RollingCarousel />
        </div>
        <One />

        <Third />
        <Two />
      </div>
    </div>
  );
}

export default Home;
